import React from 'react';

const herissonGiaveBase64 =
  'data:image/svg+xml;base64,';

export class IllustrationGiave extends React.Component<
  React.DetailedHTMLProps<React.HTMLAttributes<HTMLImageElement>, HTMLImageElement>,
  {}
> {
  public static displayName = 'Illusatation_giave';

  public render(): JSX.Element {
    return <img {...this.props} src={herissonGiaveBase64} />;
  }
}
